Every day I'm working with charts at work, might as well turn them into my first generative art.

Variations:
9 Different palettes;
5 Types of top charts;
4 Types of main charts;
7 Types of shadow charts


All made in p5.js

“Metamorphism is a process that changes preexisting rocks into new forms because of increases in temperature, pressure, and chemically active fluids. Metamorphism may affect igneous, sedimentary, or other metamorphic rocks.”

In collaboration with Furnigible Collective. A selection of mints will be used to produce a collection of physical rugs as part of Furnigible’s generative art series. 
